def generateKeysplitString(table, basekey):
    output = ""
    index = basekey
    workon = table[0]
    for value in workon:
        if index != basekey:
            output += "\n"

        fancystring = str(index)
        if value[1] > 0:
            fancystring += f"-{index + value[1]}"
        
        output += f"inst{value[0]} {fancystring}"
        
        index += value[1] + 1
    return output


